import {Component, ViewChild} from '@angular/core';
import {
  App,
  IonicPage,
  NavController,
  NavParams,
  PopoverController,
  ModalController,
  Events,
  Content,
  ToastController,
  Platform
} from 'ionic-angular';
import {Http} from '@angular/http';
import 'rxjs/Rx';
import {DomSanitizer} from '@angular/platform-browser';
import {Contacts, Contact, ContactField, ContactName} from '@ionic-native/contacts';
import {LaunchNavigator, LaunchNavigatorOptions} from '@ionic-native/launch-navigator';
import {Media, MediaObject} from '@ionic-native/media';
import {File} from '@ionic-native/file';

@IonicPage()
@Component({
  selector: 'page-message',
  templateUrl: 'message.html',
  providers: [Contacts, LaunchNavigator, Media, File]
})

export class MessagePage {
  cards: any = [];
  img: any = "data:image/jpeg;base64,";
  pdfpreview: any = "assets/imgs/pdf_preview.svg";
  mappreview: any = "assets/imgs/map_preview.svg";
  vdo: any = "http://commondatastorage.googleapis.com/gtv-videos-bucket/sample/BigBuckBunny.mp4";
  today = Date.now();
  photos: any = [];
  contactList: any;
  @ViewChild(Content) content: Content;
  locationb: any;
  photolength: any;
  recording: boolean = false;
  filePath: string;
  fileName: string;
  audio: MediaObject;
  audioList: any[] = [];

  constructor(public navCtrl: NavController,
              public navParams: NavParams,
              private http: Http,
              public appCtrl: App,
              private popoverCtrl: PopoverController,
              public modalCtrl: ModalController,
              public events: Events,
              private sanitizer: DomSanitizer,
              private contacts: Contacts,
              public toastCtrl: ToastController,
              private launchNavigator: LaunchNavigator,
              private media: Media,
              private file: File,
              public platform: Platform) {

    // fetch image
    this.events.subscribe('imageurl', photos => {
      console.log(photos);
      // this.photos.push(photos);
      this.photos = photos;
      this.photolength = photos.length;
    });

    // fetch contact
    this.events.subscribe('user contacts', contacts => {
      console.log(contacts);
      this.contactList = contacts;
    });

    // fetch location
    this.events.subscribe('user location', result => {
      console.log(result);
      this.locationb = result[0].thoroughfare + ', ' + result[0].subLocality + ', ' + result[0].locality + ', ' + result[0].subAdministrativeArea + ', ' + result[0].administrativeArea + ', ' + result[0].countryName + '.';
    });

  }

  ionViewDidLoad() {
    this.api();
  }

  api() {
    this.http.get('https://randomuser.me/api/?results=1')
      .map(data => data.json().results)
      .subscribe(result => {
        for (let val of result) {
          this.cards.push(val);
        }
      })
  }

  back(ev) {
    this.navCtrl.setRoot('TabsPage');
  }

  attach(ev) {
    let popover = this.popoverCtrl.create('AttachmentPage', {}, {cssClass: 'attachemnt'});
    popover.present({
      ev: ev
    });
  }

  onOpenPDF() {
    let modal = this.modalCtrl.create('PdfviewPage', {
      displayData: {
        pdfSource: {
          url: 'http://unec.edu.az/application/uploads/2014/12/pdf-sample.pdf'
        }
      }
    });
    modal.present();
  }

  savecontact() {
    if (this.contacts) {
      let contact: Contact = this.contacts.create();
      // let cntcnm = this.contactList.displayName;
      contact.name = new ContactName(null, this.contactList.displayName, '');
      contact.phoneNumbers = [new ContactField('mobile', this.contactList.phoneNumbers[0].value)];
      contact.save().then(
        () => console.log('Contact saved!', contact, this.presentToast()),
        (error: any) => console.error('Error saving contact.', error)
      );
    }
  }

  presentToast() {
    let toast = this.toastCtrl.create({
      message: 'Contact added successfully',
      duration: 3000,
      position: 'bottom'
    });
    toast.present();
  }

  locationpreview() {
    this.launchNavigator.navigate(this.locationb);

    let options: LaunchNavigatorOptions = {
      destinationName: this.locationb
    };

    this.launchNavigator.navigate('', options)
      .then(
        success => console.log('Launched navigator'),
        error => console.log('Error launching navigator', error)
      );
  }

  startRecord() {
    if (this.platform.is('ios')) {
      this.fileName = 'record' + new Date().getDate() + new Date().getMonth() + new Date().getFullYear() + new Date().getHours() + new Date().getMinutes() + new Date().getSeconds() + '.ogg';
      this.filePath = this.file.documentsDirectory.replace(/file:\/\//g, '') + this.fileName;
      this.audio = this.media.create(this.filePath);
    } else if (this.platform.is('android')) {
      this.fileName = 'record' + new Date().getDate() + new Date().getMonth() + new Date().getFullYear() + new Date().getHours() + new Date().getMinutes() + new Date().getSeconds() + '.mp3';
      this.filePath = this.file.externalDataDirectory.replace(/file:\/\//g, '') + this.fileName;
      this.audio = this.media.create(this.filePath);
      console.log(this.filePath)
    }
    this.audio.startRecord();
    this.recording = true;
  }

  stopRecord() {
    this.audio.stopRecord();
    let data = {filename: this.fileName};
    this.audioList.push(data);
    localStorage.setItem("audiolist", JSON.stringify(this.audioList));
    this.recording = false;
    this.getAudioList();
  }

  playAudio(file, idx) {
    if (this.platform.is('ios')) {
      this.filePath = this.file.documentsDirectory.replace(/file:\/\//g, '') + file;
      this.audio = this.media.create(this.filePath);
    } else if (this.platform.is('android')) {
      this.filePath = this.file.externalDataDirectory.replace(/file:\/\//g, '') + file;
      this.audio = this.media.create(this.filePath);
    }
    this.audio.play();
    this.audio.setVolume(1);
  }

  getAudioList() {
    if (localStorage.getItem("audiolist")) {
      this.audioList = JSON.parse(localStorage.getItem("audiolist"));
      console.log(this.audioList);
    }
  }

  close_record() {
    let recordwrapper = document.getElementById('record_audio');
    recordwrapper.style.transform = 'translateY(50px)';
    this.audio.stopRecord();
  }

}
